Patch Set 1:

This is a quick inlined prototype, needed to know if this is acceptable before I start optimization. Fragment (+/- depending on hierarchy) is:

        static const prop_info*runtime_pinfo;
        static uint32_t runtime_serial = -1;
        static char tag_runtime_c;

        if (!runtime_pinfo) {
            runtime_pinfo = __system_property_find(runtime_key);
        }
        if (runtime_pinfo) {
            serial = __system_property_serial(runtime_pinfo);
            if (serial != runtime_serial) {
                runtime_serial = serial;
                __system_property_read(runtime_pinfo, 0, buf);
                tag_runtime_c = buf[0];
            }
        }

