 > that use non-BMP chars in files (and make them use M-UTF8)

My previous change:
--- a/core/jni/android_os_Parcel.cpp
+++ b/core/jni/android_os_Parcel.cpp
@@ -476,6 +476,12 @@ static jobject android_os_Parcel_openFileDescriptor(JNIEnv* env, jclass clazz,
     if (mode&0x00000002) realMode |= S_IWOTH;

     int fd = open(name8.string(), flags, realMode);
+    //try agin with CESU-8
+    if(fd < 0) {
+        const char* name_cesu8 = env->GetStringUTFChars(name,0);
+        fd = open(name_cesu8, flags, realMode);
+        env->ReleaseStringUTFChars(name,name_cesu8);
+    }
     if (fd < 0) {
         jniThrowException(env, ``java/io/FileNotFoundException``, strerror(errno));

Patch Set 1:

Narayan Kamath 
I don't think that finding and fixing other parts of the platform that use non-BMP chars in files will work.

The function android_os_Parcel_openFileDescriptor use standard UTF-8 
can not open files that name encoded with M-UTF8. 

My path using GetStringUTFChars instead of String8 is just using M-UTF8 not standard UTF-8. So I believe my change will work. For supporting both ，change as below is better choice.

--- a/core/jni/android_os_Parcel.cpp
+++ b/core/jni/android_os_Parcel.cpp
@@ -476,6 +476,12 @@ static jobject android_os_Parcel_openFileDescriptor(JNIEnv* env, jclass clazz,
     if (mode&0x00000002) realMode |= S_IWOTH;

     int fd = open(name8.string(), flags, realMode);
+    //try agin with CESU-8
+    if(fd < 0) {
+        const char* name_cesu8 = env->GetStringUTFChars(name,0);
+        fd = open(name_cesu8, flags, realMode);
+        env->ReleaseStringUTFChars(name,name_cesu8);
+    }
     if (fd < 0) {
         jniThrowException(env, ``java/io/FileNotFoundException``, strerror(errno));

