Patch Set 1: Code-Review-1 Verified+1

(2 comments)

A few inline comments, and I would also suggest adding a corresponding encodeShiftJis() method to be called from encodeUserDataPayload(), such as:

    private static byte[] encodeShiftJis(String msg) throws CodingException
    {
        try {
            return msg.getBytes(``Shift_JIS``);
        } catch (java.io.UnsupportedEncodingException ex) {
            throw new CodingException(``Shift-JIS encode failed: `` + ex);
        }
    }

If you have any unit tests, those would be nice to add, but not a big deal because I wrote a few unit tests yesterday for this patch (in CdmaSmsTest.java in frameworks-telephony tests) which I can upload separately after we merge this one. Thanks!

